				       Rest/binary>>,
				     N, Acc, F1, _) ->
    Len = X bsl N + Acc,
    <<Utf8:Len/binary, Rest2/binary>> = Rest,
    NewFValue = unicode:characters_to_list(Utf8, unicode),
    'dfp_read_field_def_mesos.v1.Credential'(Rest2, 0, 0,
					     F1, NewFValue).


