      _ ->
	  case Key band 7 of
	    0 -> 'skip_varint_mesos.v1.Label'(Rest, 0, 0, F1, F2);
	    1 -> 'skip_64_mesos.v1.Label'(Rest, 0, 0, F1, F2);
