				      Rest/binary>>,
				    N, Acc, F1, F2, F3, F4) ->
    Key = X bsl N + Acc,
    case Key of
      24 ->
	  'd_field_mesos.v1.Volume_mode'(Rest, 0, 0, F1, F2, F3,
					 F4);
      10 ->
	  'd_field_mesos.v1.Volume_container_path'(Rest, 0, 0, F1,
