      34 ->
	  'd_field_mesos.v1.Volume_image'(Rest, 0, 0, F1, F2, F3,
					  F4);
      _ ->
	  case Key band 7 of
	    0 ->
		'skip_varint_mesos.v1.Volume'(Rest, 0, 0, F1, F2, F3,
					      F4);
	    1 ->
		'skip_64_mesos.v1.Volume'(Rest, 0, 0, F1, F2, F3, F4);
	    2 ->
		'skip_length_delimited_mesos.v1.Volume'(Rest, 0, 0, F1,
