					    undefined, undefined, [], [],
					    undefined).

'dfp_read_field_def_mesos.v1.AgentInfo'(<<10,
					  Rest/binary>>,
					Z1, Z2, F1, F2, F3, F4, F5) ->
    'd_field_mesos.v1.AgentInfo_hostname'(Rest, Z1, Z2, F1,
					  F2, F3, F4, F5);
'dfp_read_field_def_mesos.v1.AgentInfo'(<<64,
					  Rest/binary>>,
					Z1, Z2, F1, F2, F3, F4, F5) ->
    'd_field_mesos.v1.AgentInfo_port'(Rest, Z1, Z2, F1, F2,
