'dg_read_field_def_mesos.v1.ExecutorInfo'(<<1:1, X:7,
					    Rest/binary>>,
					  N, Acc, F1, F2, F3, F4, F5, F6, F7,
					  F8, F9)
    when N < 32 - 7 ->
    'dg_read_field_def_mesos.v1.ExecutorInfo'(Rest, N + 7,
