      #'mesos.v1.Resource.RevocableInfo'{} ->
	  'merge_msg_mesos.v1.Resource.RevocableInfo'(Prev, New);
      #'mesos.v1.Resource.DiskInfo.Source.Mount'{} ->
	  'merge_msg_mesos.v1.Resource.DiskInfo.Source.Mount'(Prev,
							      New);
      #'mesos.v1.Resource.DiskInfo.Source.Path'{} ->
