'v_msg_mesos.v1.Credential'(#'mesos.v1.Credential'{principal
						       = F1,
						   secret = F2},
			    Path) ->
    v_type_string(F1, [principal | Path]),
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [secret | Path])
    end,
    ok;
'v_msg_mesos.v1.Credential'(X, Path) ->
    mk_type_error({expected_msg, 'mesos.v1.Credential'}, X,
		  Path).

